import React from "react";
import Typography from "@material-ui/core/Typography";

const Copyright = React.memo(() => {
    return (
        <Typography variant="body2" color="textSecondary">
            {'Copyright © '}

            <span>Artworch</span>{' '}

            {new Date().getFullYear()}
            {'.'}
        </Typography>
    );
})

export default Copyright
